import React, { Component } from 'react';

class Popup extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        if (!this.props.arr) {
            console.log("실패");
            return 0;

        }
        else {
            console.log("tjdrhd");
            return (
                <div id="popup">
                    <div id="popmenu">
                        <p>{this.props.arr['0'].map(v => v.name)}</p>
                        <div className="exit">닫기</div>
                    </div>
                </div>
            );
        };

    }
}

export default Popup;
